import React from 'react';
import './style.css';
import {GoogleMap, withScriptjs, withGoogleMap, Marker} from "react-google-maps";
import logoPreta from '../../icons/logoBranca.jpeg';

function Map(){
    return (
        <GoogleMap 
            defaultZoom={35} 
            defaultCenter={{lat: -7.214807, lng: -35.908444}}
        />

    );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));


export default function App() {
  return (
    <div className="geral-container">
      <header>
      </header>
      <img src={logoPreta} alt="some text" width='40' height='35' />

        <a><u>lack Money Tracking</u></a>
        <ul>
            <li><a href="#">Home</a></li>
            <li><a href="#">Lojas virtuais</a></li>
            <li><a href="#">Ongs</a></li>
            <li><a href="#">Cadastrar loja</a></li>
            <li><a href="#">Sobre</a></li>
            <li><a href="#">Contato</a></li>
        </ul>

        <div className="map">
            <WrappedMap
                googleMapURL="https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places"                loadingElement={<div style={{ height: `100%` }} />}
                containerElement={<div style={{ height: `100vh` }} />}
                mapElement={<div style={{ height: `100%` }} />}
            />
        </div>
    </div>


  );
}
